INSERT INTO `GoTQuotes` VALUES (1,'1','catelynstark, robbstark','Catelyn Stark: If you lose, your father dies, your sisters die, we die. <br>Robb Stark: Well, that makes it simple then.<br>Catelyn Stark: I suppose it does.<br>'),(2,'1','arya','Fat boy: You better give me that sword! <br> Arya: You want it? I will give it to you. I have already killed one fat boy. I bet you are a liar, but I am not. I am good at killing fat boys. I like killing fat boys.<br>'),(3,'1','tywin, tyrion','Tywin: I always thought you were a stunted fool. Perhaps I was wrong. <br>Tyrion: Half wrong. I am new to strategy, but if we are going to be surrounded by three armies, it appears we cannot stay here. <br>');
